import logo from "./logo.svg";
import "./App.css";
import DigiHeader from "./component/header/header";
import Banner from "./component/banner/banner";
import { Footer } from "./component/footer/footer";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <DigiHeader />
      </header>
      <Banner />
    </div>
  );
}

export default App;
